import './App.css';
import { BrowserRouter } from 'react-router-dom';
import {io} from 'socket.io-client'

io.connect('http://localhost:3001')

function App() {
  return (
    <React.StrictMode>
    <BrowserRouter>
    <Routes>
      <Route>
      <App />
      </Route>
    </Routes>
    </BrowserRouter>
  </React.StrictMode>
  );
}

export default App;
